import Main from "./Pages/Main";
import {Route, Routes} from "react-router";
import Details from "./Pages/Details/Details";


function App() {
  return (
    <div className="bg-cyan-500 h-screen">
        <Routes>
            <Route path={'/'} element={<Main/>}/>
            <Route path={'/details'} element={<Details/>}/>
        </Routes>

    </div>
  );
}

export default App;
